import React, { useState } from "react";
import './Contact.css'

export default function Contact() {

    const showModal = () => {
    const modal = document.getElementById("thankYouModal");
    if (modal) modal.style.display = "flex";
  };

  const closeModal = () => {
    const modal = document.getElementById("thankYouModal");
    if (modal) modal.style.display = "none";
  };


  const [formData, setFormData] = useState({
    name: "",
    email: "",
    subject: "",
    message: ""
  });

  const [status, setStatus] = useState(""); // "loading", "error", "success"
  const [errorMessage, setErrorMessage] = useState("");

const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = {
      name: e.target.name.value,
      email: e.target.email.value,
      subject: e.target.subject.value,
      message: e.target.message.value,
    };

    try {
      const response = await fetch(`/api/sign-up`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData)
            });

      if (response.ok) {
        showModal();
        e.target.reset();
      } else {
        alert("Something went wrong. Please try again later.");
      }
    } catch (error) {
      console.error("Error:", error);
      alert("An error occurred. Please try again.");
    }
  };


  return (
    <section id="contact" className="contact section">
      <div className="container section-title">
        <h2 className="contact-title">Contact</h2>
        <p>Drop us a line! We love to hear from you.</p>
      </div>

      <div className="container">
        <div className="contact-row">
          {/* Left Column */}
          <div className="contact-col-left">
            <div className="info-wrap">
              <div className="info-item">
                <i className="bi bi-geo-alt"></i>
                <div>
                  <h4>Address</h4>
                  <p>Oakville, Ontario, Canada</p>
                </div>
              </div>

              <div className="info-item">
                <i className="bi bi-telephone"></i>
                <div>
                  <h4>Call Us</h4>
                  <p>+1 416 316 0285</p>
                </div>
              </div>

              <div className="info-item">
                <i className="bi bi-envelope"></i>
                <div>
                  <h4>Email Us</h4>
                  <p>contact@aithinkglobal.com</p>
                </div>
              </div>

              <iframe
                src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d92597.08485050796!2d-79.9701101!3d43.5094508!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x882b5b8b8f729979%3A0x5037b28c7231bd0!2sOakville%2C%20ON!5e0!3m2!1sen!2sca!4v1742955223278!5m2!1sen!2sca"
                className="map-iframe"
                title="Google Map"
              ></iframe>
            </div>
          </div>

          {/* Right Column */}
          <div className="contact-col-right">
            <form className="php-email-form" onSubmit={handleSubmit}>
              <div className="form-row">
                <div className="form-group half">
                  <label>Your Name</label>
                  <input
                    type="text"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group half">
                  <label>Your Email</label>
                  <input
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group full">
                  <label>Subject</label>
                  <input
                    type="text"
                    name="subject"
                    value={formData.subject}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group full">
                  <label>Message</label>
                  <textarea
                    name="message"
                    rows="10"
                    value={formData.message}
                    onChange={handleChange}
                    required
                  ></textarea>
                </div>
                <div className="form-group full text-center">
                  {status === "loading" && <div className="loading">Loading</div>}
                  {status === "error" && (
                    <div className="error-message">{errorMessage}</div>
                  )}
                  {status === "success" && (
                    <div className="sent-message">Your message has been sent. Thank you!</div>
                  )}

                  <button className="contact-button" type="submit" disabled={status === "loading"}>
                    Send Message
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
}
